def main():
    # Create user stories
    user_stories = [
        UserStory(1, "As a Data user, I want to have the 12-19-2017 deletions processed."),
        UserStory(2, "As a UI designer, I want to redesign the Resources page, so that it matches the new Broker design styles."),
        UserStory(3, "As a UI designer, I want to report to the Agencies about user testing, so that they are aware of their contributions to making Broker a better UX."),
        UserStory(4, "As a DevOps engineer, I want New Relic to provide useful data across all applications."),
