    # Create D file generator
    d_file_generator = DFileGenerator()

    # Create FABS user
    fabs_user = FABSUser("fabs_user")
    fabs_user.submit_fabs_data({"data": "example"})

    # Create agency user
    agency_user = AgencyUser("agency_user")
    agency_user.submit_fabs_data({"data": "example"})

    logging.basicConfig(level=logging.INFO)
    logging.info("User stories: ")
    for user_story in user_stories:
        logging.info(f"ID: {user_story.id}, Description: {user_story.description}")

    logging.info("Clusters: ")
    for cluster in clusters:
        logging.info(f"ID: {cluster.id}, User Stories: {[user_story.id for user_story in cluster.user_stories]}")

    logging.info("FABS Validator: ")
    logging.info(f"Validation Rules: {fabs_validator.validation_rules}")

    logging.info("D File Generator: ")
    logging.info(f"Cached Requests: {d_file_generator.cached_requests}")

    logging.info("FABS User: ")
    logging.info(f"Submissions: {fabs_user.submissions}")

    logging.info("Agency User: ")
    logging.info(f"Submissions: {agency_user.submissions}")

if __name__ == "__main__":
    main()
